mod = lambda n: int(n % (10 ** 9 + 7))
_fc = [1]
for i in range(1, 1000001):
    _fc.append(i * _fc[i - 1])
    _fc[i] = mod(_fc[i])

def fact(n):
    if -1000001 < n < 1000001:
        if n > -1:
            return _fc[n]
        else:
            return int('-' + str(_fc[abs(n)]))
    else:
        raise ValueError('values only from 1000000 to -1000000 can be factorialized\n')

def yn(b, caps=False, y='Yes', n='No'):
    if b:
        returning = y
    else:
        returning = n
    if caps == 2:
        return returning.lower()
    elif caps:
        return returning.upper()
    return returning

def prob(l, n):
    return l.count(n) / len(l)

def isSubseq(s1, s2):
    (n, m) = (len(s1), len(s2))
    (i, j) = (0, 0)
    while i < n and j < m:
        if s1[i] == s2[j]:
            i += 1
        j += 1
    return i == n

